/*Table structure for table `questions` */



DROP TABLE IF EXISTS `questions`;



CREATE TABLE `questions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `question` varchar(120) COLLATE utf8mb4_unicode_ci NOT NULL,
  `option_1` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL,
  `option_2` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL,
  `option_3` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL,
  `option_4` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL,
  `answer` varchar(128) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1',
  `user_id` int(10) unsigned NOT NULL,
  `evaluation_id` int(10) unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
